import React from 'react';
import { Link } from 'react-router-dom';
import "./Home.css"
function Home() {

    return (
        <div className="h-body">
            <div className="h-background"></div>
            <h1 className="h-title">MealPlanPro</h1>
            <div className="h-btn">
                <button className="h-btn-shopping" onClick={<Link to="/shopping-food-list"></Link>}> Shopping Food List</button>
                <button className="h-btn-recipe"><Link to="/recipe-meal-list">Recipe Meal Lists</Link></button>
                <button className="h-btn-calendar"><Link to="/calendar">Calendar</Link></button>
            </div>
        </div>
    );
}

export default Home;
